import { useRouter } from 'next/router';

const HourlyLink = ({ children, href, as, ...rest }) => {
  const router = useRouter();
  const handler = ev => {
    ev.preventDefault();
    router.push(href, as)
  }

  return <a onClick={handler}>{children}</a>
}

export default HourlyLink;
